k=A.aq("Jenis sampah organik yang diolah menjadi eco enzyme hanya sisa sayur atau buah yang mentah. Fermentasi yang menghasilkan alkohol dan asam asetat yang bersifat disinfektan hanya dapat diaplikasikan pada produk tanaman karena kandungan karbohidrat (gula) di dalamnya, karena itu pastikan sampah sisa sayur dan buah terpisah dari sampah organik atau non-organik lain. Proses fermentasi akan berlangsung 3 bulan. Bulan pertama, akan dihasilkan alcohol, kemudian pada bulan kedua akan menghasilkan cuka dan pada bulan ketiga menghasilkan enzyme. Pada bulan ketiga, EE kita sudah bisa dipanen. Caranya adalah dengan menyaring menggunakan kain yang sudah tidak terpakai atau baju juga bisa digunakan untuk saringan. Sisa atau ampas EE dapat kita gunakan untuk beberapa manfaat seperti: Sebagai starter  (ease)  atau  untuk  membantu  mempercepat proses  pembuatan  EE selanjutnya. Untuk membantu proses penguaraian di dalam septitank dengan terlebih dahulu dihancurkan dan masukkan ke dalam saluran toilet. Sebagai kompos dengan cara meletakkannya selapis demi selapis di dalam tanah.")
